script: |
  super -f text -I q10393.spq | sort > q10393.out

inputs:
  - name: q10393.spq
    data: |
      SELECT - 54 + + col1 AS col0 FROM tab0 (FORMAT parquet) WHERE + col2 * + col0 NOT BETWEEN - col0 AND col1;
  - name: tab0

outputs:
  - name: q10393.out
    data: |
      -33
      -53
      27
